INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1001, 0, 0, 1, 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1, 1.4, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, "お！\nあそこに困ってそうな人発見！", 2, "春咲 ひより", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1002, 0, 0, 1, 0, "みんなみたいに\nわたしも強くならなきゃ", 1, 1.4, "わ、わたし、\nなに言ってるんだろ\nあはは…", 0, "大切な人を\n守れるようになりたい…って", 2, "草野 優衣", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1003, 0, 0, 1, 0, "フェンシングを始めてみては？", 1, 1.4, "少しは磨かれると思いますよ。", 0, "キミに必要な集中力と感性が", 2, "士条 怜", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1004, 0, 0, 1, 0, "ねぇ、にいちゃん！", 1, 1.5, "みそぎはねぇ、\nかくれんぼやりたい！", 0, "今日はなにして遊ぶ？", 2, "穂高 みそぎ", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1006, 0, 0, 1, 0, "風宮あかりです", 1, 1.4, "私といっしょに…\nいかない？", 0, "ねぇ…", 2, "風宮 あかり", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1007, 0, 0, 1, 0, "出雲宮子なのー", 1, 1.5, "食べ物の恨みは怖いのー", 0, "プリンたべたいのー", 2, "出雲 宮子", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1008, 0, 0, 1, 0, "ボクは虹村雪。", 1, 1.4, "いいよ。\n見られることは運命さ…", 0, "キミもボクの美貌に\n吸い寄せられたんだね。", 2, "虹村 雪", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1009, 0, 0, 1, 0, "フッ…聞いて後悔するがいい！", 1, 1.4, "人呼んで「疾風の冥姫」!!", 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 2, "柊杏奈", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1010, 0, 0, 1, 0, "マホマホ王国のプリンセス、\nまほ姫どす", 1, 1.5, "ほんまおおきにやわ～♪", 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 2, "姫宮 真歩", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1011, 0, 0, 1, 0, "衣之咲璃乃です！", 1, 1.4, "ここで会ったが\n100年目～！", 0, "生き別れたお兄ちゃんを探して\n三千世界！", 2, "衣之咲 璃乃", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1012, 0, 0, 1, 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1, 1.4, "…って、お願い！\n誰にも言わないでおいて～！", 0, "ち、超能力って…\n何のことかな～？", 2, "柏崎 初音", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1016, 0, 0, 1, 0, "ちょす！\n美波鈴奈だよ～♪", 1, 1.4, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0, "一応カリスマ読モJKやってまっす！", 2, "美波 鈴奈", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1017, 0, 0, 1, 0, "はいたーい。\n喜屋武香織さー。", 1, 1.4, "でも、沖縄もとってもいいとこさー", 0, "東京は遊園地みたいなところさー", 2, "喜屋武 香織", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1018, 0, 0, 1, 0, "支倉伊緒です。", 1, 1.4, "イオちゃんって呼んでね。", 0, "先生って呼ばれるのは\nくすぐったいから", 2, "支倉 伊緒", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1020, 0, 0, 1, 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1, 1.5, "ミミをおいてかないでぇ～", 0, "あ！/\お兄ちゃ～ん\nまってよ～", 2, "茜 ミミ", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1021, 0, 0, 1, 0, "あ…あの…えっと…\n栗…林…くるみ…です……", 1, 1.5, "ふぇぇぇぇぇん……", 0, "あの……\nふぇ……", 2, "栗林 くるみ", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1022, 0, 0, 1, 0, "風宮よりです。\nあああああ！", 1, 1.4, "なんてありがとうございます！", 0, "こんな私に貴重な時間を\n割いていただき、", 2, "風宮 より", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1023, 0, 0, 1, 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1, 1.5, "私こっち行きたいー\nね、早く早くー", 0, "おにいちゃんどこいくの？\nえ？", 2, "北条 綾音", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1025, 0, 0, 1, 0, "わっ…わっ…私、\n天野すずめといいます！", 1, 1.4, "これて何か違う…\nあああすみません！", 0, "ふ、不束者ですが\nどうぞ末永く…って、", 2, "天野 すずめ", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1027, 0, 0, 1, 0, "……クスクス…私は\n…倉石恵理子……", 1, 1.4, "離しませんわ………\n絶対に…!!", 0, "あなたは…運命の……\n伴侶……", 2, "倉石 恵理子", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1028, 0, 0, 1, 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1, 1.4, "…そうでしょ？？", 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 2, "佐々木 咲恋", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1029, 0, 0, 1, 0, "桜井望だよ！\nよろしくねっ", 1, 1.4, "あはは、\n私もまだまだだなぁ～", 0, "ぇっと…\nキミ、私のこと知らないの?!", 2, "桜井 望", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1030, 0, 0, 1, 0, "デケデケデンっ！", 1, 1.4, "ショーグン、\nワタシと一緒に天下統一デース！", 0, "初めまして、\n私はニノン・ジュベール申すデス！", 2, "ニノン・ジュベール", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1031, 0, 0, 1, 0, "上喜しのぶです。\n手元のドクロが父です。", 1, 1.4, "おかしいですね……", 0, "でもって私の隣にいるのが……\nえ、見えない？", 2, "上喜 しのぶ", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1033, 0, 0, 1, 0, "目指すはビッグな\nお笑い芸人だっぺ！", 1, 1.5, "そう、\nオラのボケに突っ込める相方が…！", 0, "けんども\nそれには足りないモンが…", 2, "野戸まひる", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1034, 0, 0, 1, 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1, 1.4, "ちょ\nちょっと一杯飲んできます…！", 0, "ちょっと緊張しちゃって…", 2, "綾瀬 ゆかり", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1036, 0, 0, 1, 0, "氷川鏡華…です", 1, 1.5, "これ以上お話しすることは…\nないです！", 0, "知らない人とは話しちゃいけないので", 2, "氷川 鏡華", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1038, 0, 0, 1, 0, "柏崎…栞です。", 1, 1.4, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0, "……あ、アラーム。", 2, "柏崎 栞", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1040, 0, 0, 1, 0, "ふ、双葉碧です。", 1, 1.4, "野に咲く花が、\n唯一の話相手です。", 0, "私、一人も友達がいなくて……", 2, "双葉 碧", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1042, 0, 0, 1, 0, "三角千歌です。", 1, 1.4, "そう思っています。", 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 2, "三角 千歌", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1043, 0, 0, 1, 0, "安芸真琴だ。", 1, 1.4, "う、疑ってすまなかったな…", 0, "あぁ？\nお前のそいつの仲間か？", 2, "安芸 真琴", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1044, 0, 0, 1, 0, "わらわこそは夜を総べる者！", 1, 1.4, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0, "生けとし生ける全ての者よ！", 2, "イリヤ・オーンスタイン", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1045, 0, 0, 1, 0, "そこで騎士は妖精を乱暴に……", 1, 1.4, "ｌク、クウカに何かご用ですか!?", 0, "ぐふふふふ……はっ！", 2, "遠見 空花", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1046, 0, 0, 1, 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1, 1.4, "う～ん…\n猫ってホントに最高にゃ～♪", 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 2, "宮坂たまき", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1048, 0, 0, 1, 0, "大神美冬よ！", 1, 1.4, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0, "それでは早速クエストに…", 2, "大神 美冬", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1049, 0, 0, 1, 0, "星野静流だよ！", 1, 1.4, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0, "クエストもバトルも\n掃除も洗濯も", 2, "星野静流", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1050, 0, 0, 1, 0, "アタシは玉泉美咲。", 1, 1.5, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 0, "見ての通りの\nセクシー美少女で", 2, "玉泉美咲", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1052, 0, 0, 1, 0, "？？？", 1, 1.4, "？？？？", 0, "？？？？", 2, "リマ", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1053, 0, 0, 1, 0, "モニカ・ヴァイスヴィントだ。", 1, 1.5, "そ、そこまでいうなら\nもらってやる", 0, "菓子でつろうなどと\n稚拙な策を……", 2, "モニカ・ヴァイスヴィント", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1058, 0, 0, 1, 0, "モニカ・ヴァイスヴィントだ。", 1, 1.5, "そ、そこまでいうなら\nもらってやる", 0, "菓子でつろうなどと\n稚拙な策を……", 2, "ペコリーヌ", 1);
INSERT INTO `v1_c81bd78f7cc32a9f358d712c5da9d85f378921524258733d98c3b8aae1323a69` VALUES (0, 1059, 0, 0, 1, 0, "モニカ・ヴァイスヴィントだ。", 1, 1.5, "そ、そこまでいうなら\nもらってやる", 0, "菓子でつろうなどと\n稚拙な策を……", 2, "コッコロ", 1);
